import React, { Component } from "react";
import Login from "./components/login";
import './App.css';

class App extends Component {

  handleClick() {
    console.log("Button clicked");
  }

  render() {
    console.log("Test4")
    return (
      <React.Fragment>
        <main className="buttons">
          <Login
            test={this.handleClick}
          />
          <header className="App-header">
            Login Page
        </header>
        </main>
      </React.Fragment>
    );
  }
}

export default App;
